@HenSloman @SAPHNAsharonOBE @SAPHNAteam @iHealthVisiting First and foremost,time to breathe
Good period of preceptorship
Use their voice to both share new knowledge and skills, including their voice in developing an on going skill set,by role modelling good, mindful and compassionate leadership  .. always keep the service as the focus

@Doncaster_SN We know from our day to day work that children who can’t see and hear effectively will;
🎓not achieve educationally as well as they could have
👫not be as socially confident 
🧠 may not concentrate as well
Early identification prevents long term complications #knowyourschoolnurse
